import AppHeader from "../appHeader/AppHeader";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import MainPage from "../pages/MainPage";
import ComicsPage from "../pages/ComicsPage";

const App = () => {
  return (
    <Router>
      <div className="app">
        <AppHeader />
        <main>
          <Routes>
            <Route path="/">
              <MainPage />
            </Route>
            <Route path="/comics">
              <ComicsPage />
            </Route>
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
